import React from "react"
import Flight from '../Search/flight.js'
import Hotel from '../Search/hotel.js'
import Car from '../Search/car.js'

class TabItem extends React.Component{
  render() {
    return (
      <div>
        <li className="nav-item">
          <a className={this.props.className} href={this.props.url} data-toggle={this.props.toggle}>
            {this.props.title}
          </a>
        </li>
      </div>
    )
  }
}
export default TabItem
